This false positive report also happens when you have something like this:

    Cursor = myDatabase.rawQuery(...);
    cursor.moveToFirst();
    closeSilently(cursor);

A separate class that has `closeSilently()`:

    public static void closeSilently(java.io.Closeable closeable) {
        if (closeable != null) {
            try {
                // This is only allowed on API 16+ (JELLY_BEAN, Android 4.1+)
                closeable.close();
            } catch (IOException e) {
                e.printStackTrace();
            }
        }
    }

However, if `closeSilently()` is written like this below, then the false positive report does not happen:

    public static void closeSilently(android.database.Cursor closeableCursor) {
        if (closeableCursor != null) {
            closeableCursor.close();
        }
    }

I found this from the following documentation.
http://fbinfer.com/docs/infer-bug-types.html#RETAIN_CYCLE

The Retain Cycle is described as follows.

@class Child;
@interface Parent : NSObject {
    Child *child;
}
@end
@interface Child : NSObject {
    __weak Parent *parent;
}
@end

But I think, this is valid if "Child" is a subclass of "Parent". Here both Child and Parent are inherited from NSObject class and hence are independent. 
I think the documentation should be corrected as follows.

@class Child;
@interface Parent : NSObject {
    Child *child;
}
@end
@interface Child : Parent {
    __weak Parent *parent;
}
@end

Please correct me if I am wrong.

